import React from "react";
import { useImage } from "../context/ImageContext";
import "./Button.css";

export const Button = ({ type }) => {
  const { updateImages } = useImage();
  return (
    <div
      style={{
        border: "10px solid red",
        width: "20%",
        display: "inline-block",
      }}
    >
      <h1 onClick={() => updateImages(type)}>{type}</h1>
    </div>
  );
};
